import React, { useState, useEffect } from 'react'
import {getTimeEntry} from './helper/coreapicalls'
import { isAuthenticated } from '../auth/helper';

import Base from './Base';
import Card from './Card';
import '../styles.css';

export default function Home (){
    const [timeEntrys, setTimeEntrys] = useState([]);
    const [error, setError] = useState(false)

    const id = isAuthenticated && isAuthenticated().user.id

    const loadTimeEntry = (id) => {
        getTimeEntry(id)
        .then(data =>{
            if (data.error) {
                setError(data.error);
                console.log(error);
            }else {
                setTimeEntrys(data);
            }
        }
        );
    };

    useEffect(() => {
        loadTimeEntry(id);
    })

    return(
        <Base title = 'Nerdy' description = 'T-shirt store'>
            <h1>
                Home Component
            </h1>
            <div className = 'row'>
                {timeEntrys.map((timeEntry) => {
                    return(
                        <div key = {timeEntry.id} className = 'col-4 mb-4'>
                            <Card timeEntrys = {timeEntry}/>
                        </div>
                    )
                })}

            </div>
        </Base>
    )
}
